Logwatch is a lightweight, free and open source template for your changelog made with [Vue](https://vuejs.com), [Nuxt](https://nuxtjs.org) and [Tailwindcss](https://tailwindcss.com). It leverages [Nuxt Content] for your feed which allows you to write markdown and use them as a CMS. It has a beautiful UI and is easy to use.

```jsx
export default function Home() {
  const logs = allChangeLogs.sort((b, a) => (a.release.localeCompare(b.release)))

  return (
    <main className="min-h-screen relative">
      <Hero/>
      <section
        className="relative mx-auto max-w-5xl px-4 sm:px-6 lg:px-8 overflow-hidden"
      >
        {logs.map((log) => (
          <LogPost key={log.release} log={log}/>
        ))}
      </section>
    </main>
  )
}
```
